$(document).ready(function(){$(".equipment__carousel").slick({slidesToShow:1,slidesToScroll:1,arrows:!1,dots:!0,dotsClass:"equipment__dots",customPaging:function(a,b){var c=b+1;c=10>c?"0"+c:c;$(a.$slides[c]).data();return'<button type="button" class="equipment__dot-item">'+c+"</button>"},fade:!0})});